mapper.select:
select 

,

from TF_PSS
where PS_ID = #{psId,jdbcType=VARCHAR}
  and PS_NO = #{psNo,jdbcType=VARCHAR}
  and ITM = #{itm,jdbcType=INTEGER}

mapper.delete:
delete from TF_PSS
where PS_ID = #{psId,jdbcType=VARCHAR}
  and PS_NO = #{psNo,jdbcType=VARCHAR}
  and ITM = #{itm,jdbcType=INTEGER}
